import React from "react";
import { Stack, Typography } from "@mui/material";

import Icon from "../assets/icons/gym.png";
const BodyPart = ({ item }) => {
  return (
    <Stack
      type="button"
      alignItems="center"
      justifyContent="center"
      className="bodyPart-card"
    >
      <img
        src={Icon}
        styles={{ width: "40px", height: "40px" }}
        alt="dumbell"
      />
    </Stack>
  );
};

export default BodyPart;
